import logo from "../../images/logo.png";
import { Logo, Title, Wrapper } from "./styled";
import bg from "../../images/background.png";

export const Top = () => {
  return (
    <Wrapper bg={bg}>
      <Logo src={logo} />
      <BannerWrapper>
        <TitleTrack>
          <Title>CRIMSON LED BANNER TEXT ✦ </Title>
          <Title>CRIMSON LED BANNER TEXT ✦ </Title>
        </TitleTrack>
      </BannerWrapper>
    </Wrapper>
  );
};
